import styled from "styled-components";

export const StyledFooter = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  background-color: #332c2e;
  color: white;
  height: 2rem;
  width: 100%;
  position: fixed;
  bottom: 0;
  left: 0;
  font-size: {FONT_SIZE_SMALL}
`
